import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Login from '../src/components/Login';
import Dashboard from '../src/components/Dashboard';
import ProjectForm from './components/ProjectForm';
import ProjectList from './components/getProjects';
import DashboardChart from './components/DashboardChart';

const App = () => {
  return (
    // <Router>
    //   <Routes>
    //   <Route exact path="/dashboard" element={<Dashboard />} />
    //   <Route exact path="/" element={<Login />} />
    //   <Route exact path="/createproject" element={<ProjectForm />} />
    //   <Route exact path="/allproject" element={<ProjectList />} />

    //   </Routes>
    // </Router>
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Dashboard</Link>
            </li>
            <li>
              <Link to="/project-listing">Project Listing</Link>
            </li>
            <li>
              <Link to="/add-project">Add Project</Link>
            </li>
            <li>
              <Link to="/login">Logout</Link>
            </li>
          </ul>
        </nav>
        <div>
          <h1>Dashboard</h1>

          <DashboardChart />
        </div>
        <Routes>
          <Route path="/" exact component={Dashboard} />
          <Route path="/project-listing" component={ProjectList} />
          <Route path="/add-project" component={ProjectForm} />
          <Route path="/login" component={Login} />
        </Routes>
      </div>
    </Router>

  );
};

export default App;
